import './App.css';
import React, { Component } from 'react';
import axios from 'axios';

class App extends Component {
  constructor() {
      super();
      this.state = {
          users: []
      }
  }

  async componentDidMount() {
    const payloadInfo = {"filter":"{}",
      "ignoreAssociation": true,
      "isPaginateDB": true,
      "modelType": "journals",
      "page": 5,
      "pageSize": 100
    };
    axios.post('http://o-research-dev.orlab.com.vn/api/v1/filters/filter/', {payloadInfo})
      .then(res => {
        console.log(res);
        console.log(res.data);
        const users = res.data.data;
        this.setState({ users });
      })
  }

  renderUsers = () => {
      let users = this.state.users.map((data, index) =>
          <tr key={data.id}>
            <td>{data.id}</td>
            <td>{data.title}</td>
            <td>{data.totaldocs}</td>
            <td>{data.country}</td>
            <td>{data.year}</td>
          </tr>
      );

      return users;
  }

  render() {
    return (
      <div className="App">
        <div className="container">
          <h1 className="text-center">Users List</h1>

          <table className="table">
            <thead>
              <tr>
                <th>#</th>
                <th>Title</th>
                <th>Totaldocs</th>
                <th>Country</th>
                <th>Year</th>
              </tr>
            </thead>
            <tbody>
              {this.renderUsers()}
            </tbody>
          </table>

        </div>
      </div>
    );
  }
}

export default App;
